import ProductItem from './ProductItem';
import classes from './Products.module.css';


const DUMMY_PRODUCTS=[
  {id:p1, price:6, title: 'first book', description:'nver wrote'},
  {id:p2, price:3, title: 'second book', description:'in pastt wrote'},
  {id:p3, price:2, title: 'third book', description:'now wrote'},
  {id:p4, price:7, title: 'fourth book', description:'ever wrote'},
]

const Products = (props) => {
  return (
    <section className={classes.products}>
      <h2>Buy your favorite products</h2>
      <ul>
        {DUMMY_PRODUCTS.map((product)=>(
        <ProductItem
          title={product.title}
          price={product.price}
          description={product.description}
        />
        ))}

      </ul>
    </section>
  );
};

export default Products;
